// Import necessary libraries and components
import React from 'react';
import { Route, Routes } from 'react-router-dom';  // Import Route and Routes from react-router-dom
import BookingPage from './pages/BookingPage';  // Import the BookingPage component
import SuccessPage from './pages/SuccessPage';  // Import the SuccessPage component
import Terms from './pages/Terms';  // Import Terms component
import './styles/BookingPage.css';  // Import the necessary CSS
import './styles/Terms.css';  // Import the Terms CSS file

function App() {
  return (
    <div>
      <Routes>   {/* Define routes using Routes */}
        <Route path="/" element={<BookingPage />} />  {/* The BookingPage route */}
        <Route path="/success" element={<SuccessPage />} />  {/* The SuccessPage route */}
        <Route path="/terms" element={<Terms />} />  {/* The Terms page route */}
      </Routes>
    </div>
  );
}

export default App;
